import './ExpenseItem.css';
function ExpenseItem() {
    return (
        <div className="expense-item">
            <div>
                March 20
            </div>
            <div className="expense-item__descriptoin">
                <h2>
                    Car Insurance
                </h2>
                <div className="expense-item__price"> 1000 </div>
            </div>
        </div>
    );
}

export default ExpenseItem;
